import React from "react";
import logo from "./src/components/images react.png"
let Header = () => {
  return (
    <header>
      <nav className="flex">
        <img src="{}" alt="pic1" />
        <ul className="nostyle">
          <li>Service</li>
          <li>Offer</li>
          <li>Enjoy</li>
        </ul>
      </nav>
    </header>
  );
};
export default Header;
